import Link from 'next/link';

const Index = () => (
    <div className='outerdiv'>
        <div className='titlelogo'>
            <Link href='/'>
                <a>slern.io</a>
            </Link>
        </div>

        <style jsx>{`
        .outerdiv {
            background-color: #B0D3F3;
            width: 100%;
            height: 80px;
            display: grid;
            font-family: Arial;  
            margin: 0px;
            padding: 0px;  
            border: 0px;  

        }
        .titlelogo {
            color: #2181D5;
            font-weight: bold;
            padding: 10px;
            font-size: 20px;
            text-decoration: none;
            font-family: 'Arial';
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }

          a:hover {
            opacity: 0.6;
          }

        `}</style>
    </div>
);

export default Index;
